// src/App.js

import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';  // Import Link for navigation
import AddTransactionForm from './components/AddTransactionForm';  // Assuming you have the AddTransactionForm component
import Navbar from './components/Navbar'; // Assuming you created a Navbar

const App = () => {
    return (
        <Router>
            <Navbar />  {/* Include the Navbar */}
            <Routes>
                <Route path="/add-transaction" element={<AddTransactionForm />} />
                {/* Add other routes here */}
            </Routes>
        </Router>
    );
};

export default App;
